INSERT INTO `products` (`id`, `title`, `body`, `active_from`, `active_to`, `price`, `image`, `created_at`, `updated_at`, `user_id`) VALUES
(28, 'Iso Whey Zero prémium fehérje', '<h2>Miért ajánljuk az Iso Whey Zerót?</h2>\n\n<ul>\n	<li>Native Whey Isolate alapanyaggal készül</li>\n	<li>Kiemelkedő fehérjetartalma van</li>\n	<li>Hozzáadott aminosavakat tartalmaz: L-glutamin és BCAA</li>\n	<li>Gyors és könnyű felszívódású fehérje</li>\n	<li>Laktóz-*, cukor- és gluténmentes termék</li>\n	<li>Pálmaolajmentes</li>\n	<li>Tartósítószert nem tartalmaz</li>\n	<li>Aszpartámmentes</li>\n</ul>\n\n<p>*Maximális hígítás esetén, a fogyasztásra kész termék laktózmentes</p>\n\n<h2>A Native Whey előállítása - teljesítményed az alapanyagoknál kezdődik!</h2>\n\n<p>A <strong>Native Whey Protein Isolate-ünket közvetlenül friss tejből állítják elő</strong>, pasztörizálást követően, alacsony hőmérsékleten végzett mikro- és ultraszűréssel, majd speciális szárítókamrában történik a porítás. <strong>Ennek az egyedi eljárásnak köszönhetően a fehérjestruktúra megőrzi teljesebb formáját</strong>, illetve immunoglobulinban (antitest) és laktoferrinben (immunrendszer része) gazdag marad.</p>', '2020-04-07 23:59:59', '2020-04-14 23:59:59', 18990.00, 'data:image/png;base64,', '2020-04-07 20:41:50', '2020-04-07 20:41:50', 4);
INSERT INTO `products` (`id`, `title`, `body`, `active_from`, `active_to`, `price`, `image`, `created_at`, `updated_at`, `user_id`) VALUES
(29, 'Iso whey zero', '<h2>Miért ajánljuk az Iso Whey Zerót?</h2>\n\n<ul>\n	<li>Native Whey Isolate alapanyaggal készül</li>\n	<li>Kiemelkedő fehérjetartalma van</li>\n	<li>Hozzáadott aminosavakat tartalmaz: L-glutamin és BCAA</li>\n	<li>Gyors és könnyű felszívódású fehérje</li>\n	<li>Laktóz-*, cukor- és gluténmentes termék</li>\n	<li>Pálmaolajmentes</li>\n	<li>Tartósítószert nem tartalmaz</li>\n	<li>Aszpartámmentes</li>\n</ul>\n\n<p>*Maximális hígítás esetén, a fogyasztásra kész termék laktózmentes</p>', '2020-04-22 23:59:59', '2020-04-29 23:59:59', 4990.00, 'data:image/png;base64,', '2020-04-07 20:47:23', '2020-04-07 20:47:23', 4);
INSERT INTO `products` (`id`, `title`, `body`, `active_from`, `active_to`, `price`, `image`, `created_at`, `updated_at`, `user_id`) VALUES
(30, 'Zero Bar fehérje szelet', '<h2>Miért ajánljuk a Zero Bart?</h2>\n\n<ul>\n	<li>Összetett fehérjetartalom Native Whey Isolate alapanyaggal</li>\n	<li>Hozzáadott cukor nélkül (természetes módon előforduló cukrokat tartalmaz)</li>\n	<li>Szukralózzal</li>\n	<li>Élelmi rostban gazdag</li>\n	<li>Bevonat nélkül</li>\n	<li>Alacsony szénhidráttartalom</li>\n	<li>Ropogós fehérjetextúrákkal</li>\n	<li>Laktóz-és gluténmentes</li>\n	<li>Aszpartám-mentes</li>\n	<li>Különlegesen finom ízekben</li>\n</ul>', '2020-04-13 23:59:59', '2020-04-20 23:59:59', 500.00, 'data:image/png;base64,', '2020-04-07 20:50:29', '2020-04-07 20:50:29', 4);
INSERT INTO `products` (`id`, `title`, `body`, `active_from`, `active_to`, `price`, `image`, `created_at`, `updated_at`, `user_id`) VALUES
(31, 'Mega Omega 3', '<h2><strong>Miért ajánljuk a Mega Omega 3-at?</strong></h2>\n\n<ul>\n	<li>1000 mg halolaj adagonként</li>\n	<li>70% EPA és DHA omega-3 zsírsavtartalommal</li>\n	<li>Hozzáadott E-vitaminnal</li>\n	<li>Lágyzselatin kapszulás formula</li>\n</ul>\n\n<h2>Egyedülálló, 70% Omega 3 zsírsav tartalom az idegrendszer és a szív-érrendszer védelméért!</h2>\n\n<p>A Mega Omega 3 lágyzselatin kapszula formájában, kiemelkedő 70%-os mennyiségben tartalmaz EPA (eikozapenténsav) és DHA (dokozahexaénsav) zsírsavakat, ezen kívül tartalmaz még E-vitamint.</p>\n\n<p>Az omega-3 típusú zsírsavak ún. esszenciális zsírok, vagyis a szervezetünk nem képes ezeket előállítani, így külső forrásból kell biztosítanunk a megfelelő mennyiség bevitelét.</p>\n\n<p>Többféle omega-3 zsírsavat ismerünk. Elsődleges forrásuk a tengeri halfajták (tőkehal, tonhal, lazac, makréla, hering), azonban egyes növényi eredetű élelmiszerek is magas omega-3 zsírsav-tartalommal rendelkeznek (pl.: lenmagolaj, repceolaj).</p>\n\n<p>Amellett, hogy a többszörösen telítetlen zsírsavakban gazdag zsírok (pl.: halolaj) pozitív élettani tulajdonságai széleskörben elterjedt evidenciák, gyakori hiba, hogy ezekből a tí</p>', '2020-04-14 23:59:59', '2020-04-21 23:59:59', 2990.00, 'data:image/png;base64,', '2020-04-07 21:04:27', '2020-04-07 21:11:54', 4);
INSERT INTO `products` (`id`, `title`, `body`, `active_from`, `active_to`, `price`, `image`, `created_at`, `updated_at`, `user_id`) VALUES
(34, 'ULISSES Wave Shaker fekete - füst', '<p>600 ml űrtartalmú füst színű shaker, mely ideális a táplálékkiegészítők vízzel való összerázásához.</p>\n\n<p>Könnyen rögzíthető, felcsavarható tetővel, amely nem válik le mixelés közben.</p>\n\n<p>Közkedvelt wave dizájn, szivárgásmentes kivitelezés</p>\n\n<p>BPA és méreganyag mentes műanyagból (Made in the EU)</p>', '2020-04-22 23:59:59', '2020-04-29 23:59:59', 690.00, 'data:image/png;base64,', '2020-04-08 07:17:21', '2020-04-08 07:17:21', 4);
INSERT INTO `products` (`id`, `title`, `body`, `active_from`, `active_to`, `price`, `image`, `created_at`, `updated_at`, `user_id`) VALUES
(35, 'BioTechUSA Wave+ Shaker 600ml(+200ml+150ml)', '<p>A Wave+ egy új, három tároló elemből álló shaker, amelyben nem csak a táplálék kiegészítő porokat, de még a tablettákat is tárolhatod.</p>\n\n<p>Könnyen rögzíthető, felcsavarható, szivárgásmentes tető és tároló elemek.</p>\n\n<p> </p>\n\n<p> </p>\n\n<p>Kapacitás: <strong>600ml(+200ml+150ml)</strong></p>', '2020-04-21 23:59:59', '2020-04-28 23:59:59', 1590.00, 'data:image/png;base64,', '2020-04-08 07:20:42', '2020-04-08 07:20:42', 4);

